    false,nt"url": null,nt"notes": "This narrative report for Okefenokee National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1944. The report begins by summarizing the weather conditions, water conditions,
    food and cover, and wildfires during this period. Wildlife -including migratory
    birds, upland game birds, big animals, furbearers, raptors, and fish-  is also covered.
    The Refuge development and maintenance section discusses physical developments.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, and violations. N-R forms are attached.",nt"license_title":
